INSERT INTO resource_table VALUES('6923C0C2AE3346C49D389D4A64500291','TextField','<text lang="fr">Ce portfolio de démonstration est un portfolio vide créé avec Karuta afin de donner une petite idée des possibilités de l\''outil, plutôt que de commencer avec une page vierge.&lt;br&gt;&lt;br&gt;Ce texte et les couleurs de fond, de typographie sont personnalisables. Vous pouvez vous aussi rajouter des blocs.&lt;br&gt;&lt;br&gt;&lt;br&gt;</text><text lang="en">Karuta is free software that lets you build portfolios for universities, schools, and organizations.&lt;br&gt;&lt;br&gt;Karuta allows you to build your own portfolio process and edit portfolio structures as you wish.&lt;br&gt;</text><lastmodified>27/4/2016 15:29:09</lastmodified>',1,1,'18/07/2016 20:22:39');
