INSERT INTO resource_table VALUES('BA3FF2C880064315BC21C9570F6C42F6','TextField','<text lang="fr">Karuta est un logiciel Open Source qui permet de créer des ePortfolios. Vous bâtissez votre propre modèle de portfolio.&lt;br&gt;&lt;br&gt;</text><text lang="en">This portfolio has been built to give you an idea of the software\''s possibilities.&lt;br&gt;&lt;br&gt;The content of this page, the menu, the fonts, and the background colors can be edited.&lt;br&gt;&lt;br&gt;Just do it!&lt;br&gt;</text><lastmodified>28/4/2016 12:16:53</lastmodified>',1,1,'18/07/2016 20:22:39');
