INSERT INTO resource_table VALUES('76FAC9DCE5E24A478CD6EE73A6CC7509','TextField','<text lang="fr">Ce portfolio de démonstration est un portfolio vide créé avec Karuta afin de donner une petite idée des possibilités de l\''outil, plutôt que de commencer avec une page vierge.&lt;br&gt;&lt;br&gt;Ce texte et les couleurs de fond, de typographie sont personnalisables. Vous pouvez vous aussi rajouter des blocs.&lt;br&gt;&lt;br&gt;&lt;br&gt;</text><text lang="en">KARUTA is a free software that lets you build portfolios for&amp;nbsp; : university, school, firms...&lt;br&gt;&lt;br&gt;KARUTA lets&amp;nbsp; you build your own portfolio process and you can edit the structure as you want.&lt;br&gt;&lt;br&gt;&lt;br&gt;</text><lastmodified>2016-02-22 18:14:15</lastmodified>',1,1,'18/07/2016 20:22:44');
